import React from "react";
import { DashHeadWrap } from "../../styles/components/Dashboard/DashHeadStyle";
import SearchBar from "../MiniComponents/SearchBar";

export default function DashHeader() {
  return (
    <DashHeadWrap>
      <SearchBar />
      <div className="log"></div>
    </DashHeadWrap>
  );
}
